import React from "react";
import "./genere-list.scss"

const GenereList = ({list}) =>{
    console.log(list)
    if(!list || list.length){
        return null;
    }

    return (
            <ul className="genere-list">
                {list.map((genere) => {
                    return (<li key={genere.id}> genere.name </li>)
                })}
            </ul>
    )
}

export default GenereList
